import "./App.css";
import Map from "./Map";

function App() {
return (
    <div className="container">
        <div className="image-placeholder">
            <h2>Image Placeholder</h2>
            <img src="./place-holder.png" alt="Place Holder" />
        </div>
        <div className="map-container">
            <Map />
        </div>
    </div>
);
}

export default App;
